<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Document</title>
  </head>
  <style>
    .div {
      width: 400px;
      height: 400px;
      background-color: red;
      border-radius: 50%;
      border-top: 10px solid green;
      border-bottom: 10px solid blue;
      /* border-left: 10px solid transparent; */
      border-right: 10px solid black;
    }
    .box {
      position: relative;
      width: 400px;
      height: 400px;
      padding: 20px;
    }
    .box::after {
      left: 0;
      top: 0;
      content: "";
      position: absolute;
      width: 400px;
      height: 400px;
      border-radius: 50px; /*1*/
      border: 10px solid transparent; /*2*/
      background: linear-gradient(45deg, red, blue) border-box; /*3*/
      -webkit-mask: /*4*/ linear-gradient(#fff 0 0) padding-box,
        linear-gradient(#fff 0 0);
      -webkit-mask-composite: xor; /*5'*/
      mask-composite: exclude; /*5*/
    }
    /* .bg_blue {
      background-color: blue;
    } */
    .text_blak {
      color: black;
    }
    circle {
      fill: black;
    }

    html,
    body {
      height: 100%;
      margin: 0;
      padding: 0;
      overflow: hidden;
    }
    h1 {
      color: white;
    }
    #rect text {
      pointer-events: none;
    }

    body {
      background-color: black;
      color: #999;
      font-family: "Signika Negative", Arial, sans-serif;
      font-weight: 300;
      font-size: 17px;
      min-height: 100%;
      display: flex;
      flex-direction: column;
      align-items: center;
    }
    svg {
      overflow: visible;
      height: 100%;

      /* Fix Safari rendering bug */
      transform: translateZ(0);
    }

    path {
      stroke-width: 2;
      stroke: gray;
    }

    a {
      color: #88ce02;
      text-decoration: none;
    }
    a:hover {
      text-decoration: underline;
    }
    #div {
      width: 120px;
      height: 60px;
      pointer-events: none;
      background-color: #aa00ee;
      color: black;
      text-align: center;
      line-height: 60px;
      position: absolute;
      top: 30%;
      left: 60%;
      font-size: 32px;
    }

    .gsap-3-logo {
      width: 20vw;
      max-width: 150px;
      position: fixed;
      bottom: 15px;
      right: 15px;
    }
  </style>
